import "./CSSContents/NavBarStyle.css";
import { useState } from "react";

import { NavLink } from "react-router-dom";

function NavBar({ handleLogout }) {
    const [isLoggedIn] = useState(JSON.parse(localStorage.getItem('isLoggedIn')) || false);


    return (
        <nav>
            <NavLink to="/" id="title"> Clean energy for business</NavLink>

            <div>
                <ul id='navbar'>
                    <NavItem to='/' label='Home' />
                    <NavItem to='/Shop' label='Shop' />
                    <NavItem to='/Profile' label='Profile' />
                    <NavItem to='/co2' label='Co2Calculator' />

                </ul>
                {isLoggedIn ? (
                    <button onClick={handleLogout}>Logout</button>
                ) : null}
            </div>
        </nav >
    );
}

function NavItem({ to, label }) {
    return (
        <li>
            <NavLink to={to} activeClassName='active'>
                {label}
            </NavLink>
        </li>
    );
}

export default NavBar;
